import "./Aside_Friends.scss"
import logo from "./ava-steam-92.jpg"

const Aside_Friends=()=>{
    return(
        <div className="Aside_Friends">
            <h1>Друзья</h1>
            <img src={logo} alt="" />
            
        </div>
    )
}

export default Aside_Friends
